import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
  faCheck,
  faEnvelope,
  faPhone,
  faHome,
  faUser,
  faArrowRight
} from '@fortawesome/free-solid-svg-icons';
import './TryMeal.css';

const TryMeal = () => {
  const [formData, setFormData] = useState({
    name: '',
    phone: '',
    email: '',
    address: ''
  });

  const [formSubmitted, setFormSubmitted] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (!formData.name || !formData.phone || !formData.email || !formData.address) {
      alert('Please fill all the fields');
      return;
    }

    setFormSubmitted(true);

    // Reset form after some time
    setTimeout(() => {
      setFormData({
        name: '',
        phone: '',
        email: '',
        address: ''
      });
      setFormSubmitted(false);
    }, 5000);
  };

  const benefits = [
    "Premium quality home-style meals",
    "Free doorstep delivery",
    "No subscription commitment",
    "Cancel anytime",
    "100% money-back guarantee"
  ];

  return (
    <section class="section-fade" id="try-meal" className="py-20 lg:py-28 bg-secondary section-fade">
      <div className="container mx-auto px-4 md:px-6">
        <motion.div
          className="max-w-6xl mx-auto bg-white rounded-3xl shadow-xl overflow-hidden"
          initial={{ opacity: 0, y: 20 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.6 }}
        >
          <div className="flex flex-col lg:flex-row">
            <div className="lg:w-1/2 p-8 lg:p-12">
              <h2 className="text-3xl md:text-4xl font-bold mb-6">
                Try Our 3-Day <br />
                <span className="bg-clip-text text-transparent bg-gradient-to-r from-primary to-gray-900">
                  Trial Package
                </span>
              </h2>

              <p className="text-xl text-gray-600 mb-8">
                Experience the convenience of delicious, nutritious meals delivered to your doorstep with our no-commitment trial package.
              </p>

              <div className="mb-10">
                <div className="flex items-center gap-3 mb-5">
                  <div className="bg-primary/10 text-primary text-sm px-3 py-1 rounded-full">
                    What's included
                  </div>
                </div>

                <div className="space-y-3">
                  {benefits.map((benefit, index) => (
                    <motion.div 
                      key={index}
                      className="flex items-center gap-3"
                      initial={{ opacity: 0, y: 10 }}
                      whileInView={{ opacity: 1, y: 0 }}
                      viewport={{ once: true }}
                      transition={{ duration: 0.3, delay: index * 0.1 }}
                    >
                      <div className="flex-shrink-0 w-6 h-6 bg-primary/10 rounded-full flex items-center justify-center text-primary">
                        <FontAwesomeIcon icon={faCheck} className="w-3 h-3" />
                      </div>
                      <p className="text-gray-700">{benefit}</p>
                    </motion.div>
                  ))}
                </div>
              </div>

              <div className="bg-gray-50 rounded-2xl p-6 shadow-sm border border-gray-100 flex items-center gap-5 mb-8">
                <div className="bg-primary/10 text-primary rounded-full w-14 h-14 flex items-center justify-center flex-shrink-0">
                  <span className="text-2xl font-bold">₹</span>
                </div>
                <div>
                  <h3 className="text-xl font-semibold">Special Trial Pricing</h3>
                  <p className="text-gray-600">
                    Just <span className="text-primary font-bold">₹399</span> for 3 days of premium meals
                  </p>
                </div>
              </div>

              <div className="text-sm text-gray-500">
                Available in select locations. Terms and conditions apply.
              </div>
            </div>

            <div className="lg:w-1/2 bg-gray-50 p-8 lg:p-12">
              <h3 className="text-2xl font-bold mb-6">Get Your Free Trial</h3>

              {formSubmitted ? (
                <div className="text-center py-10">
                  <div className="inline-flex items-center justify-center w-16 h-16 rounded-full bg-green-100 text-green-600 mb-4">
                    <FontAwesomeIcon icon={faCheck} className="w-8 h-8" />
                  </div>
                  <h4 className="text-xl font-semibold mb-2">Thank You!</h4>
                  <p className="text-gray-600">
                    We've received your request. Our team will contact you shortly to arrange your 3-day trial.
                  </p>
                </div>
              ) : (
                <form onSubmit={handleSubmit} className="space-y-6">
                  <div>
                    <label htmlFor="name" className="block text-sm font-medium text-gray-700 mb-1">Full Name</label>
                    <div className="relative">
                      <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none text-gray-400">
                        <FontAwesomeIcon icon={faUser} className="w-4 h-4" />
                      </div>
                      <input
                        type="text"
                        id="name"
                        name="name"
                        value={formData.name}
                        onChange={handleChange}
                        className="block w-full pl-10 pr-3 py-3 text-gray-700 bg-white rounded-lg border border-gray-300 focus:ring-2 focus:ring-primary focus:border-primary transition-colors"
                        placeholder="Your name"
                      />
                    </div>
                  </div>

                  <div>
                    <label htmlFor="phone" className="block text-sm font-medium text-gray-700 mb-1">Phone Number</label>
                    <div className="relative">
                      <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none text-gray-400">
                        <FontAwesomeIcon icon={faPhone} className="w-4 h-4" />
                      </div>
                      <input
                        type="tel"
                        id="phone"
